import React from "react";
import {Link} from 'react-router-dom';
import {Navbar, Nav, Container} from 'react-bootstrap';
import {ReactSession} from 'react-client-session';

ReactSession.setStoreType("localStorage");

const NavBar = () => {
    console.log(session.getItem('user'))
    return(
        <Navbar bg="light" expand="lg" style={{marginBottom: "80px"}}>
        <Container>
            <Navbar.Brand href="#home">Recipies</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
                <Link className="nav-link" to="/">Home</Link>
                <Link className="nav-link" to="/details/1">Details</Link>
            </Nav>
            <Nav className="justify-content-end">
            {sessionStorage.getItem('user') != null ? <p>logged in</p> : <p>logged out</p>}
            {sessionStorage.getItem('user')}
            <Link className="nav-link" to="/login">Login</Link>
            </Nav>
            </Navbar.Collapse>
        </Container>
        </Navbar>
    );
}

export default NavBar;
